import React, { Component } from "react";
import { MDBDataTable } from "mdbreact";

const TableBody = (props) => {
  if (props.response == null) {
    const rows = (
      <tr key={1}>
        <td>No values are input yet!</td>
      </tr>
    );
    return <tbody>{rows}</tbody>;
  } else {
    const rows = props.response.nedbetalingsplan.innbetalinger.map(
      (row, index) => {
        return (
          <tr key={index}>
            <td>{row.dato}</td>
            <td>{Math.round(row.innbetaling) + "  NOK"}</td>
            <td>{Math.round(row.gebyr) + "  NOK"}</td>
            <td>{Math.round(row.renter) + "  NOK"}</td>
            <td>{Math.round(row.restgjeld) + "  NOK"}</td>
            <td>{Math.round(row.total) + "  NOK"}</td>
          </tr>
        );
      }
    );

    return <tbody>{rows}</tbody>;
  }
};

class Table extends Component {
  render() {
    const { response } = this.props;

    return (
      <div>
        <h1>Tabell</h1>
        <table className="table table-bordered table-hover">
          <thead className="thead">
            <tr>
              <th scope="col">Dato</th>
              <th scope="col">Innbetaling</th>
              <th scope="col">Gebyr</th>
              <th scope="col">Renter</th>
              <th scope="col">Restgjeld</th>
              <th scope="col">Terminkostnad</th>
            </tr>
          </thead>
          <TableBody response={response} />
        </table>
      </div>
    );
  }
}

class Table3 extends Component {
  render() {
    const { response } = this.props;
    const data = {
      columns: [
        {
          label: "Dato",
          field: "dato",
          sort: "disabled",
          width: 150,
        },
        {
          label: "Innbetaling",
          field: "innbetaling",
          sort: "asc",
          width: 270,
        },
        {
          label: "Gebyr",
          field: "gebyr",
          sort: "asc",
          width: 200,
        },
        {
          label: "Renter",
          field: "renter",
          sort: "asc",
          width: 100,
        },
        {
          label: "Start date",
          field: "date",
          sort: "asc",
          width: 150,
        },
        {
          label: "Salary",
          field: "salary",
          sort: "asc",
          width: 100,
        },
      ],
      rows: [
        {
          name: "Tiger Nixon",
          position: "System Architect",
          office: "Edinburgh",
          age: "61",
          date: "2011/04/25",
          salary: "$320",
        },
      ],
    };

    return (
      <div>
        <MDBDataTable
          striped
          bordered
          hover
          data={data}
        />
      </div>
    );
  }
}

class Table2 extends Component {
  render() {
    const { response } = this.props;

    return (
      <div>
        <MDBDataTable
          striped
          bordered
          hover
          data={<TableBody response={response} />}
        />
      </div>
    );
  }
}

export default Table3;
